import React, { useEffect, useState } from 'react';
import Logo from '../../imgs/nav-brand.png';
import useScrollPosition from '../../RainUI/useScrollPosition';
export default function Topbar() {
  const [scrolled,setScrolled] = useState(false);
  const position = useScrollPosition();
  useEffect(()=>{
    if (position == 0){
     scrolled ? setScrolled(false) : false;
    } else {
      scrolled ? false : setScrolled(true);

    }


  },[position]);

  return (
    <section className={`navbar-section ` + (scrolled ? "scrolled" : "")}>
        <nav className="phoenixbar">
                <img id="nav-brand" src={Logo}/>
                <div className="nav-content">
                    <div className="nav-links">
                        <a id="nav-link">Home</a>
                        <a id="nav-link">About</a>
                        <a id="nav-link">RoadMap</a>
                        <a id="nav-link">PartnerShips</a>
                        <a id="nav-link">Team</a>
                        <a href="contactus.html">Contact Us</a>
                    </div>
                    <div className="nav-button-wrapper">
                        <button className=""></button>
                    </div>
                </div>

        </nav>

    </section>
  )
}
